// Highly Realistic Cloud Shader
// Uses multi-octave noise for volumetric clouds

// Hash function for procedural noise
float hash(vec3 p) {
    p = fract(p * vec3(443.537, 537.247, 247.428));
    p += dot(p, p.yxz + 19.19);
    return fract((p.x + p.y) * p.z);
}

// 3D Value noise
float noise3D(vec3 p) {
    vec3 i = floor(p);
    vec3 f = fract(p);
    f = f * f * (3.0 - 2.0 * f);

    return mix(
        mix(mix(hash(i + vec3(0,0,0)), hash(i + vec3(1,0,0)), f.x),
            mix(hash(i + vec3(0,1,0)), hash(i + vec3(1,1,0)), f.x), f.y),
        mix(mix(hash(i + vec3(0,0,1)), hash(i + vec3(1,0,1)), f.x),
            mix(hash(i + vec3(0,1,1)), hash(i + vec3(1,1,1)), f.x), f.y),
        f.z);
}

// Fractional Brownian Motion for realistic cloud texture
float fbm(vec3 p, int octaves) {
    float value = 0.0;
    float amplitude = 0.5;
    float frequency = 1.0;

    for(int i = 0; i < octaves; i++) {
        value += amplitude * noise3D(p * frequency);
        frequency *= 2.0;
        amplitude *= 0.5;
    }
    return value;
}

// Cloud density function with detailed layers
float cloudDensity(vec3 p) {
    // Base cloud layer
    float base = fbm(p * 1.2 + vec3(iTime * 0.05, 0.0, iTime * 0.03), 6);

    // Fine detail layer
    float detail = fbm(p * 4.5 + vec3(iTime * 0.1, 0.0, iTime * 0.08), 4) * 0.3;

    // Height gradient (clouds thin out at edges)
    float heightGradient = smoothstep(-0.5, 0.0, p.y) * smoothstep(1.5, 0.8, p.y);

    // Combine layers
    float density = (base + detail) * heightGradient;
    density = smoothstep(0.4, 0.8, density);

    return density;
}

// Raymarching through clouds
vec4 renderClouds(vec3 ro, vec3 rd) {
    vec3 color = vec3(0.0);
    float alpha = 0.0;

    float t = 0.0;
    const int steps = 64;
    const float stepSize = 0.05;

    // Sky gradient colors
    vec3 skyTop = vec3(0.3, 0.5, 0.9);
    vec3 skyBottom = vec3(0.7, 0.85, 1.0);
    vec3 skyColor = mix(skyBottom, skyTop, rd.y * 0.5 + 0.5);

    // Sun direction
    vec3 sunDir = normalize(vec3(0.5, 0.4, -0.3));
    vec3 sunColor = vec3(1.0, 0.95, 0.8) * 2.5;

    for(int i = 0; i < steps; i++) {
        if(alpha > 0.99) break;

        vec3 pos = ro + rd * t;
        float density = cloudDensity(pos);

        if(density > 0.01) {
            // Light scattering calculation
            float lightAccum = 0.0;
            vec3 lightPos = pos;

            // March towards sun for lighting
            for(int j = 0; j < 6; j++) {
                lightPos += sunDir * 0.1;
                float lightDensity = cloudDensity(lightPos);
                lightAccum += lightDensity;
            }

            // Compute lighting
            float transmittance = exp(-lightAccum * 2.0);
            float scattering = mix(0.3, 1.0, transmittance);

            // Cloud color - blend between shadow and light
            vec3 cloudBaseColor = vec3(0.9, 0.92, 0.95);
            vec3 cloudShadowColor = vec3(0.4, 0.45, 0.5);
            vec3 cloudColor = mix(cloudShadowColor, cloudBaseColor, scattering);
            cloudColor += sunColor * pow(transmittance, 3.0) * 0.3;

            // Accumulate color with alpha blending
            float alpha_sample = density * 0.3;
            color += cloudColor * alpha_sample * (1.0 - alpha);
            alpha += alpha_sample * (1.0 - alpha);
        }

        t += stepSize;
        if(t > 4.0) break;
