    float detail = fbm(p * 4.5 + vec3(iTime * 0.1, 0.0, iTime * 0.08), 4) * 0.3;

    // Height gradient (clouds thin out at edges)
    float heightGradient = smoothstep(-0.5, 0.0, p.y) * smoothstep(1.5, 0.8, p.y);

    // Combine layers
    float density = (base + detail) * heightGradient;
    density = smoothstep(0.4, 0.8, density);

    return density;
}

// Raymarching through clouds
vec4 renderClouds(vec3 ro, vec3 rd) {
    vec3 color = vec3(0.0);
    float alpha = 0.0;

    float t = 0.0;
    const int steps = 64;
    const float stepSize = 0.05;

    // Sky gradient colors
    vec3 skyTop = vec3(0.3, 0.5, 0.9);
    vec3 skyBottom = vec3(0.7, 0.85, 1.0);
    vec3 skyColor = mix(skyBottom, skyTop, rd.y * 0.5 + 0.5);

    // Sun direction
    vec3 sunDir = normalize(vec3(0.5, 0.4, -0.3));
    vec3 sunColor = vec3(1.0, 0.95, 0.8) * 2.5;

    for(int i = 0; i < steps; i++) {
        if(alpha > 0.99) break;

        vec3 pos = ro + rd * t;
        float density = cloudDensity(pos);

        if(density > 0.01) {
            // Light scattering calculation
            float lightAccum = 0.0;
            vec3 lightPos = pos;

            // March towards sun for lighting
            for(int j = 0; j < 6; j++) {
                lightPos += sunDir * 0.1;
                float lightDensity = cloudDensity(lightPos);
                lightAccum += lightDensity;
            }

            // Compute lighting
            float transmittance = exp(-lightAccum * 2.0);
            float scattering = mix(0.3, 1.0, transmittance);

            // Cloud color - blend between shadow and light
            vec3 cloudBaseColor = vec3(0.9, 0.92, 0.95);
            vec3 cloudShadowColor = vec3(0.4, 0.45, 0.5);
            vec3 cloudColor = mix(cloudShadowColor, cloudBaseColor, scattering);
            cloudColor += sunColor * pow(transmittance, 3.0) * 0.3;

            // Accumulate color with alpha blending
            float alpha_sample = density * 0.3;
            color += cloudColor * alpha_sample * (1.0 - alpha);
            alpha += alpha_sample * (1.0 - alpha);
        }

        t += stepSize;
        if(t > 4.0) break;
    }

    // Blend with sky
    color += skyColor * (1.0 - alpha);

    // Add sun glow
    float sunDot = max(dot(rd, sunDir), 0.0);
    color += sunColor * pow(sunDot, 32.0) * (1.0 - alpha * 0.8);

    return vec4(color, 1.0);
}

void mainImage(out vec4 fragColor, in vec2 fragCoord) {
    // Normalized coordinates
    vec2 uv = (fragCoord - 0.5 * iResolution.xy) / iResolution.y;

    // Camera setup with mouse control
    float camRotX = 0.0;
    float camRotY = 0.3;

    if(iMouse.z > 0.0) {
        vec2 mouseUV = iMouse.xy / iResolution.xy;
        camRotX = (mouseUV.x - 0.5) * 6.28;
        camRotY = (mouseUV.y - 0.5) * 1.5 + 0.3;
    }

    // Camera position
    vec3 ro = vec3(0.0, 0.5, -2.0);

    // Camera rotation
    vec3 forward = vec3(sin(camRotX) * cos(camRotY), sin(camRotY), cos(camRotX) * cos(camRotY));
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), forward));
    vec3 up = cross(forward, right);

    // Ray direction
    vec3 rd = normalize(forward + uv.x * right + uv.y * up);

    // Render clouds
    fragColor = renderClouds(ro, rd);

    // Gamma correction
    fragColor.rgb = pow(fragColor.rgb, vec3(0.4545));
}
